<!DOCTYPE html>
<html>
<head>
<meta charset="UTF-8">
<title>PrototypeJungle</title>
<script type="text/javascript" src="http://ajax.googleapis.com/ajax/libs/jquery/1.7.2/jquery.min.js"></script>
<link rel="stylesheet" type="text/css"  href="/style.css"/> 

<body style="background-color:white;color:black">
  
<script src="/prototypejungle/js/util.js"></script>
<script src="/prototypejungle/js/om.js"></script>
<script src="/prototypejungle/js/instantiate.js"></script>
<script src="/prototypejungle/js/externalize.js"></script>
<script src="/prototypejungle/js/jquery.js"></script>
<script src="/prototypejungle/js/jqprotos.js"></script>

<script src="/prototypejungle/js/geom.js"></script>
<script src="/prototypejungle/js/draw.js"></script>
<script src="/prototypejungle/js/shapes.js"></script>

<script src="/prototypejungle/js/view.js"></script>
<script src="/prototypejungle/js/error.js"></script>

<script>
    
(function () {
    var om = __pj__.om;
    var draw = __pj__.draw;
    var page = __pj__.page;
    page.elementsToHideOnError = [];
    draw.bkColor = "white";
    draw.selectionEnabled = 0;
    function build() {
      draw.refresh();
    }
    var q = om.parseQuerystring();
    var itm = "https://s3.amazonaws.com/prototypejungle/item/10/anon.203885686"
    page.initPage({wsSource:itm,callback:build});
})();

</script>



</body>
</html>
